import React, { useState } from 'react';
import axios from 'axios';

function SignInPage() {
  const [fullName, setFullName] = useState('');
  const [mobile, setMobile] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();

    axios.post('http://localhost:9856/signup', { fullName, mobile, email, password })
      .then(response => {
        console.log(response.data);
        // Handle successful signup (e.g., redirect to dashboard)
      })
      .catch(error => {
        console.error('Signup failed:', error);
        // Handle signup error (e.g., display error message to user)
      });
  };

  return (
    <div className='org1'>
      <form className='forinner1 container' onSubmit={handleSubmit}>
        <div className='form-group1 container '>
          <div>FullName:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: FullName'
              value={fullName}
              onChange={(e) => setFullName(e.target.value)}
            />
          </div>
        </div>
        <div className='form-group1 container '>
          <div>MobileNo:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: 9876543210'
              value={mobile}
              onChange={(e) => setMobile(e.target.value)}
            />
          </div>
        </div>
        <div className='form-group1 container '>
          <div>EmailId:</div>
          <div className='form-group1Input container'>
            <input
              type='text'
              className=''
              placeholder='ex: example@gmail.com'
              value={email}
              onChange={(e) => setEmail(e.target.value)}
            />
          </div>
        </div>
        <div className='form-group1 container '>
          <div>Password:</div>
          <div className='form-group1Input container'>
            <input
              type='password'
              className=''
              placeholder='ex: Abc@123'
              value={password}
              onChange={(e) => setPassword(e.target.value)}
            />
          </div>
        </div>
        <button className='btn btn-success my-2' type='submit'>
          Sign Up
        </button>
      </form>
    </div>
  );
}

export default SignInPage;
